import React from 'react';
import { Routes, Route } from 'react-router-dom';
import EvaluationsList from './EvaluationsList';
import SubmitEvaluation from './SubmitEvaluation';
import ViewEvaluation from './ViewEvaluation';

const Evaluations = () => {
  return (
    <Routes>
      <Route index element={<EvaluationsList />} />
      <Route path="submit" element={<SubmitEvaluation />} />
      <Route path=":evaluationId" element={<ViewEvaluation />} />
    </Routes>
  );
};

export default Evaluations;
